import { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import SideNav from "./SideNav";
import BottomNav from "../../Components/BottomNav";

const SignUp = () => {
    const navigate = useNavigate();
    const dispatch = useDispatch();
    const { restaurant } = useSelector(state => ({...state}));
    const [restaurantName, setRestaurantName] = useState(restaurant?.restaurantName || '');
    const [restaurantAddress, setRestaurantAddress] = useState(restaurant?.restaurantAddress || '');
    const [state, setState] = useState(restaurant?.state || '');
    const [city, setCity] = useState(restaurant?.city || '');
    const [zipCode, setZipCode] = useState(restaurant?.zipCode || '');
    const [contact, setContact] = useState(restaurant?.contact || '');
    const [ownerContact, setOwnerContact] = useState(restaurant?.ownerContact || '');
    const [firstName, setFirstName] = useState(restaurant?.firstName || '');
    const [lastName, setLastName] = useState(restaurant?.lastName || '');
    const [email, setEmail] = useState(restaurant?.email || '');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');

    useEffect(() => {
        setEmail(window.localStorage.getItem('email'));
    }, []) 

    const handleOnIncDec = (str) => {
        switch(str) {
            case 'next': 
                validateStates();
                break;
            case 'back': break;
        }
    }

    const validateStates = () => {
        console.log('Check-->hello');
        if (restaurantName && restaurantAddress && state && city && zipCode && ownerContact && firstName && lastName && email && password && confirmPassword & (password === confirmPassword)) {

            dispatch({
                type: 'RESTAURANT_SIGNUP',
                payload: {
                    ...restaurant,
                    restaurantName,
                    restaurantAddress,
                    state,
                    city,
                    zipCode,
                    contact,
                    ownerContact,
                    firstName,
                    lastName,
                    email,
                    password,
                    confirmPassword
                }
            })
            navigate('/partner-signup/restaurant-type');
        } else {
            return;
        }
    }

    return (
        <div className='partner-signup container mt-5'>
            <div className='row mt-5 pt-5'>
                <SideNav />
                <div className='col-lg-6 col-md-8 col-10 ms-2'>
                    <h2 className='d-flex justify-content-start fw-light lh-lg'>Restaurant Information</h2>
                    <div className='my-3'>
                        <div className='form-group shadow p-3 my-3 row'>
                            <h6 className='text-start'>Restaurant details</h6>
                            <p className='fw-light text-start m-0'>Name, address and location</p>
                            <div className='col-12 my-3 mb-md-1 px-3'>
                                <input
                                    id='restaurant-name'
                                    type='text'
                                    className='form-control w-100'
                                    value={restaurantName}
                                    onChange={(e) => setRestaurantName(e.target.value)}
                                    placeholder='Restaurant Name'
                                />
                            </div>
                            <div className='col-12 my-3 mb-md-1 px-3'>
                                <input
                                    id='restaurant-address'
                                    type='text'
                                    className='form-control w-100'
                                    value={restaurantAddress}
                                    onChange={(e) => setRestaurantAddress(e.target.value)}
                                    placeholder='Restaurant Street Address'
                                />
                            </div>
                            <div className='col-4 my-3 mb-md-1 px-3'>
                                <input
                                    id='restaurant-state'
                                    type='text'
                                    className='form-control w-100'
                                    value={state}
                                    onChange={(e) => setState(e.target.value)}
                                    placeholder='State'
                                />
                            </div>
                            <div className='col-4 my-3 mb-md-1 px-3'>
                                <input
                                    id='restaurant-city'
                                    type='text'
                                    className='form-control w-100'
                                    value={city}
                                    onChange={(e) => setCity(e.target.value)}
                                    placeholder='City'
                                />
                            </div>
                            <div className='col-4 my-3 mb-md-1 px-3'>
                                <input
                                    id='restaurant-zip-code'
                                    type='text'
                                    className='form-control w-100'
                                    value={zipCode}
                                    onChange={(e) => setZipCode(e.target.value)}
                                    placeholder='Zip Code'
                                />
                            </div>
                        </div>

                        <div className='form-group shadow p-3 my-3 row'>
                            <h6 className='text-start'>Contact details</h6>
                            <p className='fw-light text-start m-0'>Your customers will call on this number for general enquiries</p>
                            <div className='col-12 input-group my-3 mb-md-1 px-3'>
                                <span class='input-group-text' id='basic-addon1'>+1</span>
                                <input
                                    id='restaurant-number'
                                    type='text'
                                    className='form-control'
                                    value={contact}
                                    onChange={(e) => setContact(e.target.value)}
                                    placeholder='Restaurant Contact Number'
                                />
                            </div>
                        </div>

                        <div className='form-group shadow p-3 my-3 row'>
                            <h6 className='text-start'>Restaurant owner details</h6>
                            <p className='fw-light text-start m-0'>These will be used to share revenue related communications</p>
                            <div className='col-12 input-group my-3 mb-md-1 px-3'>
                                <span class='input-group-text' id='basic-addon1'>+1</span>
                                <input
                                    id='onwer-contact-number'
                                    type='text'
                                    className='form-control'
                                    value={ownerContact}
                                    onChange={(e) => setOwnerContact(e.target.value)}
                                    placeholder='Owner Contact Number'
                                />
                            </div>
                            <div className='col-6 my-3 mb-md-1 px-3'>
                                <input
                                    id='owner-firstname'
                                    type='text'
                                    className='form-control w-100'
                                    value={firstName}
                                    onChange={(e) => setFirstName(e.target.value)}
                                    placeholder='Owner FisrtName'
                                />
                            </div>
                            <div className='col-6 my-3 mb-md-1 px-3'>
                                <input
                                    id='onwer-lastname'
                                    type='text'
                                    className='form-control w-100'
                                    value={lastName}
                                    onChange={(e) => setLastName(e.target.value)}
                                    placeholder='Owner LastName'
                                />
                            </div>
                            <div className='col-12 input-group my-3 mb-md-1 px-3'>
                                <span class='input-group-text' id='basic-addon2'>@</span>
                                <input
                                    id='onwer-email-address'
                                    type='email'
                                    className='form-control'
                                    value={email}
                                    onChange={(e) => setEmail(e.target.value)}
                                    disabled
                                    placeholder='Owner Email Address'
                                />
                            </div>
                            <div className='col-6 my-3 mb-md-1 px-3'>
                                <input
                                    id='password'
                                    type='password'
                                    className='form-control w-100'
                                    value={password}
                                    onChange={(e) => setPassword(e.target.value)}
                                    placeholder='Password'
                                />
                            </div>
                            <div className='col-6 my-3 mb-md-1 px-3'>
                                <input
                                    id='confirm-passowrd'
                                    type='password'
                                    className='form-control w-100'
                                    value={confirmPassword}
                                    onChange={(e) => setConfirmPassword(e.target.value)}
                                    placeholder='Confirm Password'
                                />
                            </div>
                        </div>
                    </div>
                </div>
                <BottomNav 
                    onIncDec={handleOnIncDec}
                />
            </div>
        </div>
    )
}

export default SignUp;
